import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <div className="form-control">
                    <div className="shadowClass">
                        <button className={this.state.active && 'active'} onClick={() => this.setState({ active: !this.state.active })}>
                            <span class="fa fa-star leftAlign starSize"></span>
                            <span class="centerText"> Do. Or do not. There is no try </span>
                            <span class="fa fa-star rightAlign fa-lg starSize"></span>
                        </button>
                    </div>
                </div>
            </header>
        </div>
    );
}

export default App;
